4	FAQ's	\N	1	<h2 data-start="166" data-end="199"> <strong data-start="172" data-end="199">FAQs &ndash; Locaffy Handmade</strong></h2>\r\n<h3 data-start="201" data-end="239">1. <strong data-start="208" data-end="237">What is Locaffy Handmade?</strong></h3>\r\n<p data-start="240" data-end="428">Locaffy Handmade is an online marketplace that connects customers with skilled artisans and makers who create unique, handcrafted products using traditional techniques and local materials.</p>\r\n<hr data-start="430" data-end="433" />\r\n<h3 data-start="435" data-end="481">2. <strong data-start="442" data-end="479">Are all products really handmade?</strong></h3>\r\n<p data-start="482" data-end="628">Yes! Every item listed on Locaffy Handmade is crafted by artisans or small businesses using manual or semi-manual techniques &mdash; no mass production.</p>\r\n<hr data-start="630" data-end="633" />\r\n<h3 data-start="635" data-end="672">3. <strong data-start="642" data-end="670">How do I place an order?</strong></h3>\r\n<p data-start="673" data-end="840">Simply browse the product listings, add your favorite items to the cart, and proceed to secure checkout. You&rsquo;ll receive a confirmation email once your order is placed.</p>\r\n<hr data-start="842" data-end="845" />\r\n<h3 data-start="847" data-end="900">4. <strong data-start="854" data-end="898">Can I customize or personalize products?</strong></h3>\r\n<p data-start="901" data-end="1054">Many artisans offer custom options. If available, you&rsquo;ll see a &ldquo;Customization&rdquo; or &ldquo;Notes&rdquo; section on the product page where you can add your preferences.</p>\r\n<hr data-start="1056" data-end="1059" />\r\n<h3 data-start="1061" data-end="1106">5. <strong data-start="1068" data-end="1104">Where do the products ship from?</strong></h3>\r\n<p data-start="1107" data-end="1274">Products are shipped directly from the artisan&rsquo;s workshop or studio. This ensures authenticity and reduces warehousing costs, which supports fair pricing for creators.</p>\r\n<hr data-start="1276" data-end="1279" />\r\n<h3 data-start="1281" data-end="1322">6. <strong data-start="1288" data-end="1320">How long does delivery take?</strong></h3>\r\n<p data-start="1323" data-end="1485">Delivery timelines vary depending on the artisan's location and product preparation time. Estimated delivery dates are shown on each product page during checkout.</p>	\N	\N	\N	\N	2025-05-26 13:35:16	2025-05-26 13:35:16	0
5	Contact Us	\N	1	<h2 data-start="91" data-end="130"> <strong data-start="97" data-end="130">Contact Us &ndash; Locaffy Handmade</strong></h2>\r\n<p data-start="132" data-end="276">We&rsquo;d love to hear from you! Whether you have a question about an order, want to collaborate, or just want to say hello &mdash; feel free to reach out.</p>\r\n<hr data-start="278" data-end="281" />\r\n<h3 data-start="283" data-end="310"> <strong data-start="290" data-end="310">Customer Support</strong></h3>\r\n<p data-start="312" data-end="441"><strong data-start="312" data-end="322">Email:</strong> <a class="cursor-pointer" rel="noopener" data-start="323" data-end="372">support@locaffy.com</a><br data-start="372" data-end="375" /><strong data-start="375" data-end="394">Phone/WhatsApp:</strong> +234-XXX-XXX-XXXX (Mon&ndash;Fri, 9:00 AM &ndash; 6:00 PM)</p>\r\n<hr data-start="443" data-end="446" />\r\n<h3 data-start="448" data-end="485"> <strong data-start="456" data-end="485">Order &amp; Product Inquiries</strong></h3>\r\n<p data-start="487" data-end="578">For questions about your orders, custom requests, or issues with a product, please include:</p>\r\n<ul data-start="579" data-end="674">\r\n<li data-start="579" data-end="598">\r\n<p data-start="581" data-end="598">Your Order Number</p>\r\n</li>\r\n<li data-start="599" data-end="613">\r\n<p data-start="601" data-end="613">Product Name</p>\r\n</li>\r\n<li data-start="614" data-end="649">\r\n<p data-start="616" data-end="649">Description of the issue (if any)</p>\r\n</li>\r\n<li data-start="650" data-end="674">\r\n<p data-start="652" data-end="674">Photos (if applicable)</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3 data-start="681" data-end="718">&nbsp;</h3>\r\n<hr data-start="676" data-end="679" />	\N	\N	\N	\N	2025-05-26 13:36:47	2025-05-26 13:36:47	0
6	About Us	\N	1	<h3 data-start="189" data-end="241"> <strong data-start="196" data-end="241">About Us ( Locaffy Handmade)</strong></h3>\r\n<p data-start="243" data-end="604"><strong data-start="243" data-end="311">Welcome to Locaffy Handmade &ndash; Where Local Craft Meets the World.</strong><br data-start="311" data-end="314" />We are a curated marketplace dedicated to promoting local artisans and handmade products. At Locaffy, we believe every craft tells a story &mdash; and we&rsquo;re here to help you share yours. Our mission is to connect skilled vendors with customers who appreciate authenticity, quality, and tradition.</p>\r\n<p>&nbsp;</p>\r\n<p data-start="606" data-end="798">Whether you're a weaver, woodworker, ceramicist, or jewelry maker, we provide a supportive platform that helps you showcase your creations, manage your sales, and grow your business digitally.</p>	\N	\N	\N	\N	2025-05-26 13:38:25	2025-05-26 13:38:25	1
7	Contact Us	\N	1	<h3 data-start="805" data-end="859"> <strong data-start="812" data-end="859">Contact Us (Locaffy Handmade)</strong></h3>\r\n<p data-start="861" data-end="919">Got questions, suggestions, or issues? We&rsquo;re here to help.</p>\r\n<ul data-start="921" data-end="1145">\r\n<li data-start="921" data-end="1000">\r\n<p data-start="923" data-end="1000"><strong data-start="923" data-end="947">Vendor Support Email</strong>: <a class="cursor-pointer" rel="noopener" data-start="949" data-end="998">vendors@locaffy.com</a></p>\r\n</li>\r\n<li data-start="1001" data-end="1044">\r\n<p data-start="1003" data-end="1044"><strong data-start="1003" data-end="1023">WhatsApp Support</strong>: +234-XXX-XXX-XXXX</p>\r\n</li>\r\n<li data-start="1045" data-end="1096">\r\n<p data-start="1047" data-end="1096"><strong data-start="1047" data-end="1063">Office Hours</strong>: Mon &ndash; Fri | 9:00 AM &ndash; 6:00 PM</p>\r\n</li>\r\n<li data-start="1097" data-end="1145">\r\n<p data-start="1099" data-end="1145"><strong data-start="1099" data-end="1111">Location</strong>: 123 Artisan Lane, Lagos, Nigeria</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p data-start="1147" data-end="1226">You can also use the Vendor Contact Form on your dashboard for instant support.</p>	\N	\N	\N	\N	2025-05-26 13:39:01	2025-05-26 13:39:01	1
8	Terms and Conditions	\N	1	<h3 data-start="1233" data-end="1276"> <strong data-start="1240" data-end="1276">Terms &amp; Conditions (Vendor Side)</strong></h3>\r\n<ol data-start="1278" data-end="2042">\r\n<li data-start="1278" data-end="1379">\r\n<p data-start="1281" data-end="1379"><strong data-start="1281" data-end="1296">Eligibility</strong>: Vendors must be original creators or authorized sellers of the products listed.</p>\r\n</li>\r\n<li data-start="1380" data-end="1481">\r\n<p data-start="1383" data-end="1481"><strong data-start="1383" data-end="1403">Product Listings</strong>: All products must be handmade, locally produced, and accurately described.</p>\r\n</li>\r\n<li data-start="1482" data-end="1570">\r\n<p data-start="1485" data-end="1570"><strong data-start="1485" data-end="1496">Pricing</strong>: Vendors are responsible for setting and updating their product prices.</p>\r\n</li>\r\n<li data-start="1571" data-end="1667">\r\n<p data-start="1574" data-end="1667"><strong data-start="1574" data-end="1595">Order Fulfillment</strong>: Vendors must process and ship orders within the promised time frame.</p>\r\n</li>\r\n<li data-start="1668" data-end="1764">\r\n<p data-start="1671" data-end="1764"><strong data-start="1671" data-end="1685">Commission</strong>: Locaffy charges a platform commission on each sale (as per current policy).</p>\r\n</li>\r\n<li data-start="1765" data-end="1860">\r\n<p data-start="1768" data-end="1860"><strong data-start="1768" data-end="1779">Payouts</strong>: Vendor payouts are processed weekly/monthly to their registered bank account.</p>\r\n</li>\r\n<li data-start="1861" data-end="1951">\r\n<p data-start="1864" data-end="1951"><strong data-start="1864" data-end="1889">Intellectual Property</strong>: Vendors must not list counterfeit or plagiarized products.</p>\r\n</li>\r\n<li data-start="1952" data-end="2042">\r\n<p data-start="1955" data-end="2042"><strong data-start="1955" data-end="1970">Termination</strong>: Accounts may be suspended for policy violations or poor performance.</p>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p data-start="2044" data-end="2122">Full terms available on the Vendor Dashboard or <a class="" href="#" rel="noopener" data-start="2092" data-end="2122">terms.locaffy.com/vendors</a></p>	\N	\N	\N	\N	2025-05-26 13:39:31	2025-05-26 13:39:31	1
9	Privacy Policy	\N	1	<h3 data-start="2129" data-end="2168"> <strong data-start="2136" data-end="2168">Privacy Policy (Vendor Side)</strong></h3>\r\n<p>&nbsp;</p>\r\n<ul data-start="2170" data-end="2680">\r\n<li data-start="2170" data-end="2274">\r\n<p data-start="2172" data-end="2274">We collect personal and business information to create your vendor account and process transactions.</p>\r\n</li>\r\n<li data-start="2275" data-end="2371">\r\n<p data-start="2277" data-end="2371">Data such as your name, contact details, product listings, and bank info is stored securely.</p>\r\n</li>\r\n<li data-start="2372" data-end="2491">\r\n<p data-start="2374" data-end="2491">We do not share your private information with third parties without consent, except for legal or operational needs.</p>\r\n</li>\r\n<li data-start="2492" data-end="2561">\r\n<p data-start="2494" data-end="2561">Cookies and analytics are used to improve platform functionality.</p>\r\n</li>\r\n<li data-start="2562" data-end="2680">\r\n<p data-start="2564" data-end="2680">You may request deletion or correction of your data by contacting <a class="cursor-pointer" rel="noopener" data-start="2630" data-end="2679">privacy@locaffy.com</a>.</p>\r\n</li>\r\n</ul>	\N	\N	\N	\N	2025-05-26 13:40:00	2025-05-26 13:40:00	1
10	FAQ's	\N	1	<h3 data-start="2687" data-end="2727"> <strong data-start="2693" data-end="2727">Vendor FAQs &ndash; Locaffy Handmade</strong></h3>\r\n<h4 data-start="2729" data-end="2773">1. <strong data-start="2737" data-end="2771">How do I register as a vendor?</strong></h4>\r\n<p data-start="2774" data-end="2900">Go to <a class="" href="#" rel="noopener" data-start="2780" data-end="2816">www.locaffy.com/vendor-register</a> and complete the onboarding form. After admin review, your store will be activated.</p>\r\n<h4 data-start="2902" data-end="2949">2. <strong data-start="2910" data-end="2947">What kind of products can I sell?</strong></h4>\r\n<p data-start="2950" data-end="3026">Only handmade or locally crafted items are allowed &mdash; no mass-produced goods.</p>\r\n<h4 data-start="3028" data-end="3067">3. <strong data-start="3036" data-end="3065">How are payments handled?</strong></h4>\r\n<p data-start="3068" data-end="3197">Locaffy collects payments from customers. Your earnings are transferred to your bank account (less commission) weekly or monthly.</p>\r\n<h4 data-start="3199" data-end="3262">4. <strong data-start="3207" data-end="3260">Can I update my product listing after publishing?</strong></h4>\r\n<p data-start="3263" data-end="3356">Yes, you can edit prices, descriptions, stock, and images from your vendor dashboard anytime.</p>\r\n<h4 data-start="3358" data-end="3422">5. <strong data-start="3366" data-end="3420">What happens if I miss an order or delay delivery?</strong></h4>\r\n<p data-start="3423" data-end="3500">Repeated delays or missed orders may lead to account suspension or penalties.</p>\r\n<h4 data-start="3502" data-end="3559">6. <strong data-start="3510" data-end="3557">Is there a subscription fee to be a vendor?</strong></h4>\r\n<p data-start="3560" data-end="3657">Currently, we charge only a commission on sales. No upfront subscription fee (subject to change).</p>\r\n<h4 data-start="3659" data-end="3706">7. <strong data-start="3667" data-end="3704">How can I contact vendor support?</strong></h4>\r\n<p>&nbsp;</p>\r\n<p data-start="3707" data-end="3814">Use the dashboard chat, email <a class="cursor-pointer" rel="noopener" data-start="3737" data-end="3786">vendors@locaffy.com</a>, or reach out via WhatsApp.</p>	\N	\N	\N	\N	2025-05-26 13:40:24	2025-05-26 13:40:24	1
3	About Us	\N	1	<h3 data-start="121" data-end="150"> <strong data-start="128" data-end="150">About Us &ndash; Locaffy</strong></h3>\r\n<p>&nbsp;</p>\r\n<p data-start="152" data-end="636">Locaffy is your trusted destination for unique, handmade, and locally sourced products crafted with love and authenticity. We connect passionate artisans and small businesses with customers seeking meaningful and high-quality goods. Our platform empowers local creators to showcase their work, grow their brand, and reach a wider audience. At Locaffy, we believe in preserving traditional craftsmanship and promoting ethical commerce through a seamless digital marketplace experience.</p>	\N	\N	\N	\N	2025-05-20 10:21:47	2025-05-29 05:38:47	0
2	Terms and Conditions	\N	1	<h3 data-start="643" data-end="684"> <strong data-start="650" data-end="684">Terms and Conditions &ndash; Locaffy</strong></h3>\r\n<p data-start="686" data-end="818">Welcome to Locaffy. By accessing or using our platform, you agree to comply with and be bound by the following terms and conditions:</p>\r\n<p>&nbsp;</p>\r\n<ol data-start="820" data-end="1688">\r\n<li data-start="820" data-end="938">\r\n<p data-start="823" data-end="938"><strong data-start="823" data-end="849">Account Responsibility</strong>: Users are responsible for maintaining the confidentiality of their account credentials.</p>\r\n</li>\r\n<li data-start="939" data-end="1061">\r\n<p data-start="942" data-end="1061"><strong data-start="942" data-end="962">Product Listings</strong>: Vendors are solely responsible for the accuracy, quality, and legality of their product listings.</p>\r\n</li>\r\n<li data-start="1062" data-end="1187">\r\n<p data-start="1065" data-end="1187"><strong data-start="1065" data-end="1084">Payments &amp; Fees</strong>: All transactions are processed through our secure payment gateway. Platform fees may apply as stated.</p>\r\n</li>\r\n<li data-start="1188" data-end="1338">\r\n<p data-start="1191" data-end="1338"><strong data-start="1191" data-end="1218">Cancellations &amp; Refunds</strong>: Policies regarding cancellations, returns, and refunds are set by individual vendors and must be clearly communicated.</p>\r\n</li>\r\n<li data-start="1339" data-end="1437">\r\n<p data-start="1342" data-end="1437"><strong data-start="1342" data-end="1362">Prohibited Items</strong>: Selling counterfeit, harmful, or restricted items is strictly prohibited.</p>\r\n</li>\r\n<li data-start="1438" data-end="1575">\r\n<p data-start="1441" data-end="1575"><strong data-start="1441" data-end="1463">Dispute Resolution</strong>: Any disputes between buyers and sellers must be resolved in good faith; Locaffy may mediate at its discretion.</p>\r\n</li>\r\n<li data-start="1576" data-end="1688">\r\n<p data-start="1579" data-end="1688"><strong data-start="1579" data-end="1604">Modification of Terms</strong>: Locaffy reserves the right to update these terms at any time without prior notice.</p>\r\n</li>\r\n</ol>	\N	\N	\N	\N	2025-01-20 17:04:48	2025-05-29 05:39:07	0
1	Privacy Policy	\N	1	<h3 data-start="1695" data-end="1730"> <strong data-start="1702" data-end="1730">Privacy Policy &ndash; Locaffy</strong></h3>\r\n<p data-start="1732" data-end="1836">Your privacy is important to us. This policy explains how we collect, use, and protect your information:</p>\r\n<ul data-start="1838" data-end="2472">\r\n<li data-start="1838" data-end="1936">\r\n<p data-start="1840" data-end="1936"><strong data-start="1840" data-end="1866">Information We Collect</strong>: Name, email, phone number, address, payment details, and usage data.</p>\r\n</li>\r\n<li data-start="1937" data-end="2038">\r\n<p data-start="1939" data-end="2038"><strong data-start="1939" data-end="1956">How We Use It</strong>: To fulfill orders, improve our services, process transactions, and send updates.</p>\r\n</li>\r\n<li data-start="2039" data-end="2206">\r\n<p data-start="2041" data-end="2206"><strong data-start="2041" data-end="2057">Data Sharing</strong>: We do not sell your data. Information may be shared with third-party service providers strictly to operate our platform (e.g., payment processors).</p>\r\n</li>\r\n<li data-start="2207" data-end="2284">\r\n<p data-start="2209" data-end="2284"><strong data-start="2209" data-end="2220">Cookies</strong>: We use cookies to enhance user experience and analyze traffic.</p>\r\n</li>\r\n<li data-start="2285" data-end="2392">\r\n<p data-start="2287" data-end="2392"><strong data-start="2287" data-end="2302">Your Rights</strong>: You can request access to, correction of, or deletion of your personal data at any time.</p>\r\n</li>\r\n<li data-start="2393" data-end="2472">\r\n<p data-start="2395" data-end="2472"><strong data-start="2395" data-end="2407">Security</strong>: We implement industry-standard measures to safeguard your data.</p>\r\n</li>\r\n</ul>	\N	\N	\N	\N	2025-01-20 17:04:03	2025-05-29 05:39:26	0
